document.addEventListener("DOMContentLoaded",function(){gslUIkit.container=document.getElementById("gslc");var navbar=document.querySelector(".gsl-navbar-right  .gsl-navbar-nav");if(navbar){navbar.classList.remove("gsl-hidden")}var buttons=gslUIkit.container.querySelectorAll(".btn-primary");buttons.forEach(function(button){button.classList.remove("btn-primary");button.classList.add("gsl-button-primary")});buttons=gslUIkit.container.querySelectorAll(".btn");buttons.forEach(function(button){button.classList.remove("btn");button.classList.add("gsl-button");button.classList.add("gsl-button-small");if(!button.classList.contains("gsl-button-primary")&&!button.classList.contains("gsl-button-danger")&&!button.classList.contains("gsl-button-warning")&&!button.classList.contains("gsl-button-success")){button.classList.add("gsl-button-default")}})});ys_popover(".hasYsPopover, .hasPopover");